CREATE TABLE IF NOT EXISTS `USERS` (
	id_user int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    firstname varchar(255) NOT NULL,
    lastname varchar(255) NOT NULL,
    username varchar(255) NOT NULL,
    email varchar(255) NOT NULL,
    password varchar(255) NOT NULL,
    image varchar(255) DEFAULT 'default.png' NOT NULL,
    gender varchar(10),
    sex_pref varchar(20),
    biography varchar(255),
    age int,
    interests varchar(255),
    rating int default 1,
    online varchar(1) default 'N',
    time datetime,
    completed int(1) NOT NULL DEFAULT 0,
    verified int(1) NOT NULL DEFAULT 0,
    NotifActiv int(1) NOT NULL DEFAULT 1,
    verification_code varchar(255),
    forgetPass varchar(255)
);

CREATE TABLE IF NOT EXISTS `IMAGES` (
	id_img int AUTO_INCREMENT PRIMARY KEY NOT NULL,
	id_user int NOT NULL,
    FOREIGN KEY(id_user) REFERENCES USERS(id_user) ON DELETE CASCADE,
    image varchar(255) NOT NULL,
    date datetime
);

CREATE TABLE IF NOT EXISTS `USER_COORDS` (
	id_coords int AUTO_INCREMENT PRIMARY KEY NOT NULL,
	id_user int NOT NULL,
    FOREIGN KEY(id_user) REFERENCES USERS(id_user) ON DELETE CASCADE,
    latitude varchar(255),
    longitude varchar(255),
    seated int(1) NOT NULL DEFAULT 0
);

CREATE TABLE IF NOT EXISTS `VIEWS` (
	id_view int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_user_p int NOT NULL,
    FOREIGN KEY(id_user_p) REFERENCES USERS(id_user) ON DELETE CASCADE,
    id_user_v int NOT NULL,
    FOREIGN KEY(id_user_v) REFERENCES USERS(id_user) ON DELETE CASCADE,
    date_view datetime,
    read_view varchar(1) default 'N'
);

CREATE TABLE IF NOT EXISTS `INTERESTS` (
	id_inter int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    interest varchar(255)
);

CREATE TABLE IF NOT EXISTS `BLOCKES` (
	id_block int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_user_from int NOT NULL,
    FOREIGN KEY(id_user_from) REFERENCES USERS(id_user) ON DELETE CASCADE,
    id_user_to int NOT NULL,
    FOREIGN KEY(id_user_to) REFERENCES USERS(id_user) ON DELETE CASCADE,
    date_block datetime
);

CREATE TABLE IF NOT EXISTS `REPORTS` (
	id_report int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_user_from int NOT NULL,
    FOREIGN KEY(id_user_from) REFERENCES USERS(id_user) ON DELETE CASCADE,
    id_user_to int NOT NULL,
    FOREIGN KEY(id_user_to) REFERENCES USERS(id_user) ON DELETE CASCADE,
    date_report datetime
);

CREATE TABLE IF NOT EXISTS `MESSAGE` (
	id_msg int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    from_user_id int NOT NULL,
    FOREIGN KEY(from_user_id) REFERENCES USERS(id_user) ON DELETE CASCADE,
    to_user_id int NOT NULL,
    FOREIGN KEY(to_user_id) REFERENCES USERS(id_user) ON DELETE CASCADE,
    message text,
    read_msg varchar(1) default 'N',
    date datetime
);

CREATE TABLE IF NOT EXISTS `LIKES` (
	id_like int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_user_from int NOT NULL,
    FOREIGN KEY(id_user_from) REFERENCES USERS(id_user) ON DELETE CASCADE,
    id_user_to int NOT NULL,
    FOREIGN KEY(id_user_to) REFERENCES USERS(id_user) ON DELETE CASCADE,
    date_like datetime
);

CREATE TABLE IF NOT EXISTS `NOTIFICATION` (
	id_notif int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    id_user_from int NOT NULL,
    FOREIGN KEY(id_user_from) REFERENCES USERS(id_user) ON DELETE CASCADE,
    id_user_to int NOT NULL,
    FOREIGN KEY(id_user_to) REFERENCES USERS(id_user) ON DELETE CASCADE,
    message varchar(255),
    read_notif varchar(1) default 'N',
    date_notif datetime
);








